(3, 1, 32, 'Defacto T-Shirt Homme - Noir', 'defacto-t-shirt-homme-noir', '<span style=\"color: rgb(40, 40, 40); font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 14px;\">Fondée en <b>2003</b>, DEFACTO fait partie, aujourd’hui, des marques de mode les plus populaires en Turquie et dans le monde avec plus de 242 magasins. Elle se positionne comme une marque pionnière de la mode à travers le monde méditerranéen.</span><div><img src=\"data:image/jpeg;base64,\" style=\"width: 558.984px;\" data-filename=\"1dd0e8d5bd7d28748ba7917a3b6367c7.jpg\"><span style=\"color: rgb(40, 40, 40); font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 14px;\"><br></span></div>', '49', '69', NULL, 1, '[\"t-shirt\",\"mode home\"]', '[{\"La Taille\":\"S\",\"qty\":\"100\",\"prix\":\"49\",\"image\":null},{\"La Taille\":\"M\",\"qty\":\"100\",\"prix\":\"49\",\"image\":null},{\"La Taille\":\"L\",\"qty\":\"100\",\"prix\":\"49\",\"image\":null},{\"La Taille\":\"XL\",\"qty\":\"100\",\"prix\":\"49\",\"image\":null}]', 'unpublished', 1, '2021-08-26 10:42:08', '2021-09-07 10:06:05', NULL);
