(4, 1, 32, 'Tshirt Split Attack on Titan Symbol - T-shirt Black & White ANIME Otaku Teeshort MANGA', 'tshirt-split-attack-on-titan-symbol-t-shirt-black-white-anime-otaku-teeshort-manga', '<p style=\"padding: 8px 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(40, 40, 40); font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 14px;\">Les t-shirts que l’on trouve dans la boutique sont inspirés des plus célèbres Stars de la Mode.</p><p style=\"padding: 8px 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(40, 40, 40); font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 14px;\">D’une très bonne qualité d’impression, et qualité de tissu, mélangeant coton et des matières fibreuses pour pouvoir se mouvoir plus aisément, et avoir une résistance au lavage jusqu\'à 60 degréé.</p><p style=\"padding: 8px 0px; margin-right: 0px; margin-left: 0px; color: rgb(40, 40, 40); font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 14px;\">D’abord réservé à un public étroit, les modèles se sont depuis développé pour être un accessoire tout à fait utilisable dans la réalité quotidienne en laissant paraître plus de nuance dans l’expression de leur passion.</p><p style=\"padding: 8px 0px; margin-right: 0px; margin-left: 0px; color: rgb(40, 40, 40); font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 14px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"2 (1).jpg\" style=\"width: 500px;\"></p><p style=\"padding: 8px 0px; margin-right: 0px; margin-left: 0px; color: rgb(40, 40, 40); font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 14px;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 500.328px;\" data-filename=\"5.jpg\"><br></p>', '129', '154', NULL, 1, '[\"t-shirt\"]', '[{\"La Taille\":\"S\",\"qty\":null,\"prix\":null,\"image\":null},{\"La Taille\":\"M\",\"qty\":null,\"prix\":null,\"image\":null},{\"La Taille\":\"L\",\"qty\":null,\"prix\":null,\"image\":null}]', 'unpublished', 1, '2021-09-06 08:54:04', '2021-09-07 10:06:02', NULL);
