(11, 1, 35, 'Chemises à manches courtes Summer Hawaiian Vacation Party', 'chemises-a-manches-courtes-summer-hawaiian-vacation-party', '<p>Expédition et emballageTous les articles seront vérifiés et bien emballés avant l\'envoi. Les articles seront expédiés dans les 1 jours ouvrables suivant le paiement de la commande par les acheteurs. Il faut généralement environ 14 à 18 jours ouvrables pour livrer le colis à destination (pour les régions éloignées, cela peut prendre un peu plus de temps). Annonce spéciale : veuillez indiquer le destinataire, l\'adresse et le numéro de téléphone corrects et détaillés dans la commande. Pour une livraison rapide et correcte. Si vous ne recevez pas de commande dans les 30 jours ouvrables, n\'hésitez pas à contacter le service client avant de laisser des commentaires négatifs et neutres, .TaxNo, vous ne paierez que ce que est indiqué comme coût total à la caisse, pas plus. Vous n\'êtes pas tenu de payer des droits ou taxes supplémentaires. Si la douane ou notre partenaire logistique vous demande de payer des droits, veuillez contacter notre service client Retour. Si le produit n\'est pas en bon état, vous pouvez retourner ce produit dans les 260 jours ouvrables, veuillez contacter le centre de service client avant de retourner. est notre première priorité Si vous recevez la commande et qu\'elle est en bon état, nous vous serions reconnaissants de nous laisser des commentaires positifs CINQ étoiles pour la transaction.</p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"9c8bae317383eecf5f7b45eda47d8378.jpg\"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"6.jpg\"><br></p>', '181', '242', NULL, 1, '[\"Chemises \",\"ete\"]', '[{\"La Taille\":\"S\",\"La Couleur\":\"Bleu\",\"qty\":\"10\",\"prix\":150,\"image\":null},{\"La Taille\":\"S\",\"La Couleur\":\"Noir\",\"qty\":\"0\",\"prix\":70,\"image\":null},{\"La Taille\":\"M\",\"La Couleur\":\"Bleu\",\"qty\":\"10\",\"prix\":90,\"image\":null},{\"La Taille\":\"M\",\"La Couleur\":\"Noir\",\"qty\":\"10\",\"prix\":800,\"image\":null},{\"La Taille\":\"L\",\"La Couleur\":\"Bleu\",\"qty\":\"10\",\"prix\":900,\"image\":null},{\"La Taille\":\"L\",\"La Couleur\":\"Noir\",\"qty\":\"10\",\"prix\":100,\"image\":null},{\"La Taille\":\"XL\",\"La Couleur\":\"Bleu\",\"qty\":\"0\",\"prix\":200,\"image\":null},{\"La Taille\":\"XL\",\"La Couleur\":\"Noir\",\"qty\":\"0\",\"prix\":250,\"image\":null},{\"La Taille\":\"XXL\",\"La Couleur\":\"Bleu\",\"qty\":\"10\",\"prix\":780,\"image\":null},{\"La Taille\":\"XXL\",\"La Couleur\":\"Noir\",\"qty\":\"0\",\"prix\":9000,\"image\":null}]', 'published', 1, '2021-09-06 10:14:00', '2021-09-07 13:30:11', NULL);
